void
bcm_server_mim_lookup_id_stat_counter_get(cpudb_key_t r_cpu, uint8 *r_pkt, void *r_cookie)
{
	uint8	*r_pp;
	uint32	r_seq;
	int	r_ret;
	int	r_i;
	int	unit;
	int	lookup_id;
	bcm_mim_stat_t	stat;
	uint32	num_entries;
	uint32 *	r_p_counter_indexes;
	bcm_stat_value_t *	r_p_counter_values;

	r_pp = r_pkt;
	BCM_UNPACK_U32(r_pp, r_seq);
	r_pp = r_pkt + BCM_RPC_HLEN;
	r_ret = BCM_E_NONE;
	BCM_UNPACK_U32(r_pp, unit);
	BCM_UNPACK_U32(r_pp, lookup_id);
	BCM_UNPACK_U32(r_pp, stat);
	BCM_UNPACK_U32(r_pp, num_entries);
	if (*r_pp++ == 1) {
		r_p_counter_indexes = NULL;
	} else {
		r_p_counter_indexes = sal_alloc(num_entries*sizeof(uint32), "rpc counter_indexes");
		if (r_p_counter_indexes == NULL) {
			r_ret = BCM_E_MEMORY;
		} else {
			for (r_i = 0; r_i < num_entries; r_i++) {
				BCM_UNPACK_U32(r_pp, *(r_p_counter_indexes+r_i));
			}
		}
	}
	if (*r_pp++ == 1) {
		r_p_counter_values = NULL;
	} else {
		r_p_counter_values = (void *)1;
	}
	if (r_p_counter_values != NULL) {
		r_p_counter_values = sal_alloc(num_entries*sizeof(bcm_stat_value_t), "rpc counter_values");
		if (r_p_counter_values == NULL) {
			r_ret = BCM_E_MEMORY;
		}
	}
	bcm_rpc_free(r_pkt, r_cookie);

	if (r_ret == BCM_E_NONE) {
		r_ret = bcm_mim_lookup_id_stat_counter_get(unit, lookup_id, stat, num_entries, r_p_counter_indexes, r_p_counter_values);
	}

	if (r_p_counter_indexes != NULL) {
		sal_free(r_p_counter_indexes);
	}

	r_pkt = bcm_rpc_setup('S', (uint32 *)0, 4+(num_entries*20), r_seq, r_ret);
	r_pp = r_pkt + BCM_RPC_HLEN+4;
	if ((r_ret >= 0) && (r_pkt != NULL)) {
		if (r_p_counter_values != NULL) {
			for (r_i = 0; r_i < num_entries; r_i++) {
				r_pp = _bcm_pack_stat_value(r_pp, r_p_counter_values+r_i);
			}
		}
	}

	if (r_p_counter_values != NULL) {
		sal_free(r_p_counter_values);
	}

	bcm_rpc_reply(r_cpu, r_pkt, r_pp-r_pkt);
}

