void
bcm_server_multicast_ingress_get(cpudb_key_t r_cpu, uint8 *r_pkt, void *r_cookie)
{
	uint8	*r_pp;
	uint32	r_seq;
	int	r_ret;
	int	r_i;
	int	unit;
	bcm_multicast_t	group;
	int	port_max;
	int	port_count;
	bcm_gport_t *	r_p_port_array;
	bcm_if_t *	r_p_encap_id_array;
	int *	r_p_port_count;

	r_pp = r_pkt;
	BCM_UNPACK_U32(r_pp, r_seq);
	r_pp = r_pkt + BCM_RPC_HLEN;
	r_ret = BCM_E_NONE;
	BCM_UNPACK_U32(r_pp, unit);
	BCM_UNPACK_U32(r_pp, group);
	BCM_UNPACK_U32(r_pp, port_max);
	if (*r_pp++ == 1) {
		r_p_port_array = NULL;
	} else {
		r_p_port_array = (void *)1;
	}
	if (*r_pp++ == 1) {
		r_p_encap_id_array = NULL;
	} else {
		r_p_encap_id_array = (void *)1;
	}
	if (*r_pp++ == 1) {
		r_p_port_count = NULL;
	} else {
		r_p_port_count = &port_count;
	}
	if (r_p_port_array != NULL) {
		r_p_port_array = sal_alloc(port_max*sizeof(bcm_gport_t), "rpc port_array");
		if (r_p_port_array == NULL) {
			r_ret = BCM_E_MEMORY;
		}
	}
	if (r_p_encap_id_array != NULL) {
		r_p_encap_id_array = sal_alloc(port_max*sizeof(bcm_if_t), "rpc encap_id_array");
		if (r_p_encap_id_array == NULL) {
			r_ret = BCM_E_MEMORY;
		}
	}
	bcm_rpc_free(r_pkt, r_cookie);

	if (r_ret == BCM_E_NONE) {
		r_ret = bcm_multicast_ingress_get(unit, group, port_max, r_p_port_array, r_p_encap_id_array, r_p_port_count);
	}

	r_pkt = bcm_rpc_setup('S', (uint32 *)0, 8+(port_max*4)+(port_max*4), r_seq, r_ret);
	r_pp = r_pkt + BCM_RPC_HLEN+4;
	if ((r_ret >= 0) && (r_pkt != NULL)) {
		if (r_p_port_array != NULL) {
			for (r_i = 0; r_i < port_max; r_i++) {
				BCM_PACK_U32(r_pp, *(r_p_port_array+r_i));
			}
		}
		if (r_p_encap_id_array != NULL) {
			for (r_i = 0; r_i < port_max; r_i++) {
				BCM_PACK_U32(r_pp, *(r_p_encap_id_array+r_i));
			}
		}
		if (r_p_port_count != NULL) {
			BCM_PACK_U32(r_pp, *r_p_port_count);
		}
	}

	if (r_p_port_array != NULL) {
		sal_free(r_p_port_array);
	}
	if (r_p_encap_id_array != NULL) {
		sal_free(r_p_encap_id_array);
	}

	bcm_rpc_reply(r_cpu, r_pkt, r_pp-r_pkt);
}

